document.querySelectorAll('.accordion-toggle').forEach(function (button) {
  button.addEventListener('click', function (e) {
    e.preventDefault();
    if (window.innerWidth > 1024) {
      return;
    }
    var id = button.getAttribute('href');
    var panel = document.querySelector(id);
    if (!panel) return;
    var isOpen = panel.style.maxHeight && panel.style.maxHeight !== '0px';
    if (isOpen) {
      panel.style.maxHeight = panel.scrollHeight + 'px';
      requestAnimationFrame(function () {
        panel.style.maxHeight = '0px';
        button.classList.remove('current');
        button.querySelector('.arrow-icon').style.transform = 'rotate(0deg)';
        // Пересчитать высоты родителей
        updateParentHeights(panel);
      });
    } else {
      panel.style.maxHeight = 'none';
      var scrollHeight = panel.scrollHeight;
      panel.style.maxHeight = '0px';
      requestAnimationFrame(function () {
        panel.style.maxHeight = scrollHeight + 'px';
        button.classList.add('current');
        button.querySelector('.arrow-icon').style.transform = 'rotate(90deg)';

        // После анимации: сделать overflow: visible
        setTimeout(function () {
          // Пересчитать высоты родителей
          updateParentHeights(panel);
        }, 500); // duration = 500ms
      });
    }
  });
});

// 📦 Функция для пересчёта всех родительских accordion-content
function updateParentHeights(panel) {
  var parent = panel.parentElement;
  while (parent) {
    if (parent.classList.contains('accordion-content')) {
      parent.style.maxHeight = 'none';
      var newHeight = parent.scrollHeight;
      parent.style.maxHeight = newHeight + 'px';
    }
    parent = parent.parentElement;
  }
}
